import React from 'react';
const Archmodal = (props) => {
    //<div style={{width:'130px',height:'20px',backgroundColor:'#8ceaee',borderRadius:'5px'}}>itm.name</div>
    console.log(props.nodes);
    const nds = props.nodes;
    return (<div className="modal-background" >
        <div className="modal-itself">
            <div className="arch-nodes" style={{position:'absolute',width:'150px',height:'calc(100% - 20px)',top:'10px',left:'10px',borderRadius:'5px',borderStyle:'solid',borderStyle:'solid',borderWidth:'1px'}}></div>
            {
                nds.map((itm,indx) => {
                    <div>itm.name</div>
                })
            }
            <span onClick={props.cls_mdl} className="x-modal">X</span>
        </div>
    </div>);
 }
 export default Archmodal;
